// Place this block at the very top of App.tsx, before all imports
const originalConsoleWarn = console.warn.bind(console);
console.warn = (msg, ...args) => {
  const warningsToHide = [
    "BackHandler is not supported on web and should not be used",
    'shadow* style props are deprecated. Use "boxShadow".',
    "You are loading @emotion/react when it is already loaded.",
    "style.resizeMode is deprecated. Please use props.resizeMode.",
    // Add more patterns here as needed
  ];

  const shouldHideWarning = warningsToHide.some((warningPattern) =>
    msg.includes(warningPattern)
  );

  if (!shouldHideWarning) {
    originalConsoleWarn(msg, ...args);
  }
};

// Now follow with your imports and the rest of your code
import React from "react";
import RouteManager from "./navigation/RouteManager"; // Adjust the import path as necessary

const App = () => {
  return <RouteManager />;
};

export default App;
